// Ilja Test

const App = () => {
  return (
    // <div className='app'data-theme={theme}>
        <BrowserRouter>
            <Navbar/>
            <Routes>
                <Route path='/' element={<Home/>}/>
                <Route path='/login' element={<Login/>}/>
